pragma solidity ^0.5.0;




contract CA is ERC20, ERC20Detailed, ERC20Pausable {
    string  public constant NAME = "CA-Chain Token";
    string  public constant SYMBOL = "CA";
    uint8   public constant DECIMALS = 18;
    uint256 public constant TOTAL_SUPPLY = 5000000000 * (10 ** uint256(DECIMALS));
    constructor(
    )
        ERC20()
        ERC20Detailed(NAME, SYMBOL, DECIMALS)
        ERC20Pausable()
        public 
    {
        _mint(msg.sender, TOTAL_SUPPLY);
    }

	/**
	 * 批量转账
	 */
	function batchTransfer(address[] memory _receivers, uint256 _value) 
	public
	whenNotPaused  
	returns (bool) {
		uint _count = _receivers.length;
		uint256 _amount = _value.mul(uint(_count));
		require(_count > 0 && _count <= 20);
		require(_value > 0 && balanceOf(msg.sender) >= _amount);

        for (uint i = 0; i < _count; i++) {
            _transfer(msg.sender, _receivers[i], _value);
        }
        return true;
    }
}
